import React from "react";
import MenuItemWithDropdown from "./MenuItemWithDropdown";
import './Menu.css'

const Menu = () => {
  return (
    <ul className="ul-menu">
      <MenuItemWithDropdown
        title="Sobre nós"
        dropdownItems={["Quem somos", "Por que visitar", "Regulamentos", "Política de privacidade"]}
      />
      <MenuItemWithDropdown
        title="Visitação"
        dropdownItems={["Mapa da feira", "Hotéis", "Restaurantes", ""]}
      />
      <MenuItemWithDropdown
        title="Programação"
        dropdownItems={["Palestras", "Workshops", "Atividades"]}
      />
      <MenuItemWithDropdown
        title="Expositores"
        dropdownItems={["Lista de expositores", "Mapa dos estandes"]}
      />
      <MenuItemWithDropdown
        title="Parceiros"
        dropdownItems={["Lista de parceiros", "Patrocinadores"]}
      />
    </ul>
  );
};

export default Menu;
